// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract LiquidityPool is ERC20 {
    IERC20 public tokenA;
    IERC20 public tokenB;

    // count tokenA in poool
    uint256 public reserveA;
    // count tokenB in poool
    uint256 public reserveB;

    // internal event to log
    event Debug(string txt);

    constructor(address _tokenA, address _tokenB) ERC20("LP Token", "LPT") {
        tokenA = IERC20(_tokenA);
        tokenB = IERC20(_tokenB);

        //approve ?
    }

    function addLiquidity(
        address _tokenA,
        address _tokenB,
        uint amountADesired,
        uint amountBDesired,
        uint amountAMin,
        uint amountBMin,
        address to,
        uint deadline
    ) external returns (uint amountA, uint amountB, uint liquidity) {
        require(block.timestamp <= deadline, "Transaction expired");
        require(_tokenA == address(tokenA) && _tokenB == address(tokenB), "Invalid tokens");

        // review
        (amountA, amountB) = _calculateAmounts(amountADesired, amountBDesired, amountAMin, amountBMin);

        emit Debug("addLiquidity - antes transfer");
        // transfer tokens from user to this contract
        require(tokenA.transferFrom(msg.sender, address(this), amountA), "tokenA transfer failed");
        require(tokenB.transferFrom(msg.sender, address(this), amountB), "tokenB transfer failed");

        // Uniswap version to calculate liquidity and then Mint LP tokens
        if (totalSupply() == 0) {
            liquidity = _sqrt(amountA * amountB);
        } else {
            liquidity = _min(
                (amountA * totalSupply()) / reserveA,
                (amountB * totalSupply()) / reserveB
            );
        }

        //TODO: revisar from doc
        //Si reserveA = 100 A y reserveB = 200 B, y el usuario agrega 10 A y 20 B, el contrato calculará cuántos tokens de liquidez (L) se emitirán:
        // test if totalSupply == 0
        // ERROR: inicialmente divide por 0
        //uint liquidityFromDoc = _min( (amountA / reserveA), (amountB / reserveB) ) * totalSupply();

        require(liquidity > 0, "Invalid liquidity");
        // mint LP Tokens
        _mint(to, liquidity);

        // Update reserves
        reserveA += amountA;
        reserveB += amountB;
    }

    function _calculateAmounts(
        uint amountADesired,
        uint amountBDesired,
        uint amountAMin,
        uint amountBMin
    ) internal view returns (uint amountA, uint amountB) {
        if (reserveA == 0 && reserveB == 0) {
            amountA = amountADesired;
            amountB = amountBDesired;
        } else {
            uint amountBOptimal = (amountADesired * reserveB) / reserveA;
            if (amountBOptimal <= amountBDesired) {
                require(amountBOptimal >= amountBMin, "amountB too low");
                amountA = amountADesired;
                amountB = amountBOptimal;
            } else {
                uint amountAOptimal = (amountBDesired * reserveA) / reserveB;
                require(amountAOptimal >= amountAMin, "amountA too low");
                amountA = amountAOptimal;
                amountB = amountBDesired;
            }
        }
    }

    function _min(uint x, uint y) internal pure returns (uint) {
        return x < y ? x : y;
    }

    function _sqrt(uint y) internal pure returns (uint z) {
        if (y > 3) {
            z = y;
            uint x = y / 2 + 1;
            while (x < z) {
                z = x;
                x = (y / x + x) / 2;
            }
        } else if (y != 0) {
            z = 1;
        }
    }

    // 2 Remover Liquidez (removeLiquidity)
    function removeLiquidity(
        address _tokenA, 
        address _tokenB, 
        uint liquidity, 
        uint amountAMin, 
        uint amountBMin, 
        address to, 
        uint deadline) 
    external returns (uint amountA, uint amountB) {
        require(_tokenA == address(tokenA) && _tokenB == address(tokenB), "Invalid tokens");
        require(block.timestamp <= deadline, "Transaction expired");
        require(liquidity > 0, "Invalid liquidity");
        require(amountBMin >= 0, "Invalid amountBMin"); // TODO review from verify
        require(amountAMin >= 0, "Invalid amountAMin"); // TODO review from verify

        emit Debug("removeLiquidity - antes totalSupply");
        // pending amountAMin, amountBMin: Mínimos aceptables para evitar fallos.
        uint totalLPTokens = totalSupply();
        require(totalLPTokens > 0, "Invalid supply");

        // first multiply, then divide. Values to return
        amountA = (liquidity * reserveA) / totalLPTokens;
        amountB = (liquidity * reserveB) / totalLPTokens;


        //TODO: revisar from doc
        //uint amountAFromDoc = (liquidity / totalLPTokens) * reserveA;
        //uint amountBFromDoc = (liquidity / totalLPTokens) * reserveB;

        require(amountA >= amountAMin, "amountA below min");
        require(amountB >= amountBMin, "amountB below min");

        //tokenA.transferFrom(msg.sender, to, amountA);
        //tokenB.transferFrom(msg.sender, to, amountB);

        emit Debug("removeLiquidity - antes transfer");
        
        require(tokenA.transfer(to, amountA), "Transfer tokenA failed");
        require(tokenB.transfer(to, amountB), "Transfer tokenB failed");

        emit Debug("removeLiquidity - antes burn");
        // burn LP tokens
        //_burn(address(this), liquidity);
        _burn(to, liquidity); //TODO OR: _burn(msg.sender, liquidity);

        emit Debug("removeLiquidity - despues burn");

        // update reserves
        reserveA -= amountA;
        reserveB -= amountB;
        emit Debug("removeLiquidity - END");
    }

    // 2 to test
    /*
    function removeLiquidity(
    address _tokenA,
    address _tokenB,
    uint liquidity,
    uint amountAMin,
    uint amountBMin,
    address to,
    uint deadline
