    require(block.timestamp <= deadline, "Transaction expired");
    require(_tokenA == address(tokenA) && _tokenB == address(tokenB), "Invalid token pair");
    require(liquidity > 0, "Invalid liquidity amount");

    uint totalLPTokens = totalSupply();
    require(totalLPTokens > 0, "No liquidity in pool");

    // Calcular proporción a devolver
    amountA = (liquidity * reserveA) / totalLPTokens;
    amountB = (liquidity * reserveB) / totalLPTokens;

    require(amountA >= amountAMin, "amountA below min");
    require(amountB >= amountBMin, "amountB below min");

    // Quemar LP tokens del usuario
    _burn(msg.sender, liquidity);

    // Actualizar reservas
    reserveA -= amountA;
    reserveB -= amountB;

    // Transferir tokens al usuario
    require(tokenA.transfer(to, amountA), "Transfer tokenA failed");
    require(tokenB.transfer(to, amountB), "Transfer tokenB failed");
}
*/

    // 3 Intercambiar Tokens (swapExactTokensForTokens)
    function swapExactTokensForTokens(
        uint amountIn, 
        uint amountOutMin, 
        address[] calldata path, 
        address to, 
        uint deadline) 
    external returns (uint[] memory amounts) {
        require(amountIn > 0 && amountOutMin > 0, "Invalid amounts");
        require(block.timestamp <= deadline, "Transaction expired");
        require(path.length == 2, "Invalid tokens count");

        address tokenInAddr = path[0];
        address tokenOutAddr = path[1];

        //
        require(
        (tokenInAddr == address(tokenA) && tokenOutAddr == address(tokenB)), "Invalid tokens");

        IERC20 inputToken = IERC20(tokenInAddr);
        IERC20 outputToken = IERC20(tokenOutAddr);

        uint256 reserveIn = reserveA;
        uint256 reserveOut = reserveB;

        uint256 amountIn256 = amountIn; // to resolve compilation error
        require(inputToken.transferFrom(msg.sender, address(this), amountIn256), "Transfer failed");

        uint amountOut = (amountIn256 * reserveOut) / (reserveIn + amountIn256);
        require(amountOut >= amountOutMin, "Insufficient output amount");

        require(outputToken.transfer(to, amountOut), "Transfer failed");

        reserveA += amountIn;
        reserveB -= amountOut;

        // return amounts
        amounts = new uint[](2);
        amounts[0] = amountIn;
        amounts[1] = amountOut;


        /*
        bool isAtoB = tokenInAddr == address(tokenA);
        IERC20 inputToken = isAtoB ? tokenA : tokenB;
        IERC20 outputToken = isAtoB ? tokenB : tokenA;

        uint reserveIn = isAtoB ? reserveA : reserveB;
        uint reserveOut = isAtoB ? reserveB : reserveA;
        
        //TODO: revisar from doc
//        Al realizar el swap, Uniswap efectúa una transferencia desde su pool hacia el usuario con el token que este está comprando y realiza un transferFrom desde el usuario hacia su propio pool con el token que el usuario está utilizando para adquirir el otro token.


        emit Debug("swapExactTokensForTokens - despues burn");

        uint256 amountIn256 = amountIn; // todo revisar uint
        // Transfer tokenIn from sender
        require(inputToken.transferFrom(msg.sender, address(this), amountIn256), "Transfer failed");

        // Calcular cantidad a recibir
        uint amountOut = (amountIn256 * reserveOut) / (reserveIn + amountIn);
        require(amountOut >= amountOutMin, "Insufficient output amount");

        // Transferir token de salida
        require(outputToken.transfer(to, amountOut), "Transfer failed");

        // Actualizar reservas
        if (isAtoB) {
            reserveA += amountIn;
            reserveB -= amountOut;
        } else {
            reserveB += amountIn;
            reserveA -= amountOut;
        }

        */

        // Retornar cantidades
        amounts = new uint[](2);
        amounts[0] = amountIn;
        amounts[1] = amountOut;
    }

    // 3 to test
    /*
    function swapExactTokensForTokens(
    uint amountIn,
    uint amountOutMin,
    address[] calldata path,
    address to,
    uint deadline
) external returns (uint[] memory amounts) {
    require(block.timestamp <= deadline, "Transaction expired");
    require(path.length == 2, "Only direct swaps supported");

    address tokenInAddr = path[0];
    address tokenOutAddr = path[1];

    require(
        (tokenInAddr == address(tokenA) && tokenOutAddr == address(tokenB)) ||
        (tokenInAddr == address(tokenB) && tokenOutAddr == address(tokenA)),
        "Invalid token pair"
    );

    bool isAtoB = tokenInAddr == address(tokenA);
    IERC20 inputToken = isAtoB ? tokenA : tokenB;
    IERC20 outputToken = isAtoB ? tokenB : tokenA;

    uint reserveIn = isAtoB ? reserveA : reserveB;
    uint reserveOut = isAtoB ? reserveB : reserveA;

    // Transfer tokenIn from sender
    require(inputToken.transferFrom(msg.sender, address(this), amountIn), "Transfer failed");

    // Calcular cantidad a recibir
    uint amountOut = (amountIn * reserveOut) / (reserveIn + amountIn);
    require(amountOut >= amountOutMin, "Insufficient output amount");

    // Transferir token de salida
    require(outputToken.transfer(to, amountOut), "Transfer failed");

    // Actualizar reservas
    if (isAtoB) {
        reserveA += amountIn;
        reserveB -= amountOut;
    } else {
        reserveB += amountIn;
        reserveA -= amountOut;
    }

    // Retornar cantidades
    amounts = new uint ;
    amounts[0] = amountIn;
    amounts[1] = amountOut;
}
*/

    // 4 getPrice
    function getPrice(
        address _tokenA, 
        address _tokenB) 
    external view returns (uint price) {
        // revisar requiere
        require(_tokenA == address(tokenA) && _tokenB == address(tokenB), "Invalid tokens");
        require(reserveA > 0, "Invalid reservaA");
        require(reserveB > 0, "Invalid reservaB");
        
        //price = (reserveB * 1e18) / reserveA;
        price = (reserveB * 1e18) / reserveA;
//        return reserveA / reserveB; // error de redondeo
    }

    // 4 revisar to test
    /*
    function getPrice(address _tokenA, address _tokenB) external view returns (uint price) {
    require(
        (_tokenA == address(tokenA) && _tokenB == address(tokenB)) ||
        (_tokenA == address(tokenB) && _tokenB == address(tokenA)),
        "Invalid token pair"
    );

    if (_tokenA == address(tokenA)) {
        require(reserveA > 0, "No reserveA");
        price = (reserveB * 1e18) / reserveA;
    } else {
        require(reserveB > 0, "No reserveB");
        price = (reserveA * 1e18) / reserveB;
    }
    */

    // 5 getAmountOut
    function getAmountOut(uint amountIn, uint reserveIn, uint reserveOut) external pure returns (uint amountOut) {
        require(amountIn > 0, "Invalid amountIn");
        require(reserveIn > 0, "Invalid reserveIn");
        require(reserveOut > 0, "Invalid reserveOut");

        /*
        amountOut= 
                    reserveIn+amountIn
                    amountIn×reserveOut
                    */
        amountOut = (amountIn * reserveOut) / (reserveIn + amountIn);
    }

}

